import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import LoginPage from "../pages/LoginPage";
import DashboardPage from "../pages/DashboardPage";
import DashboardWrapper from "../components/DashboardWrapper";
import EmployeesPage from "../pages/EmployeesPage";
import DepartmentsPage from "../pages/DepartmentsPage";
import DesignationsPage from "../pages/DesignationsPage";
import DocumentsPage from "../pages/DocumentsPage";
import RecruitmentPage from "../pages/RecruitmentPage";
import PerformanceReviewsPage from "../pages/PerformanceReviewsPage";
import SettingsPage from "../pages/SettingsPage";
import ProtectedRoute from "./ProtectedRoute";
import ProtectedLayout from "../layouts/ProtectedLayout";

// Employee Pages
import EmployeeDashboardPage from "../pages/employees/DashboardPage";
import EmployeeAttendancePage from "../pages/employees/AttendancePage";
import EmployeeLeavesPage from "../pages/employees/LeavesPage";
import EmployeeSalariesPage from "../pages/employees/SalariesPage";
import EmployeePayslipsPage from "../pages/employees/PayslipsPage";
import EmployeeAnnouncementsPage from "../pages/employees/AnnouncementsPage";
import EmployeeProfilePage from "../pages/employees/ProfilePage";

const AppRouter = () => (
  <BrowserRouter>
    <Routes>
      <Route path="/login" element={<LoginPage />} />

      <Route
        path="/"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <DashboardPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/dashboard"
        element={
          <ProtectedRoute>
            <EmployeeDashboardPage />
          </ProtectedRoute>
        }
      />

      <Route
        path="/employees"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <EmployeesPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/departments"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <DepartmentsPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/designations"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <DesignationsPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/attendance"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <EmployeeAttendancePage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/leaves"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <EmployeeLeavesPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/salaries"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <EmployeeSalariesPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/payslips"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <EmployeePayslipsPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/documents"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <DocumentsPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/recruitment"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <RecruitmentPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/performance-reviews"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <PerformanceReviewsPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/announcements"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <EmployeeAnnouncementsPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/settings"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <SettingsPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/profile"
        element={
          <ProtectedRoute>
            <ProtectedLayout>
              <EmployeeProfilePage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route path="*" element={<Navigate to="/dashboard" replace />} />
    </Routes>
  </BrowserRouter>
);

export default AppRouter;
